22 библиотеки и 16 культурных центров столицы оснастили аппаратами для безналичной оплаты услуг. Как сообщается на официальном портале Мэра и Правительства Москвы, также платежные терминалы, принимающие карты или наличные, появились в 57 городских учреждениях культуры. 
Отмечается, что столичные библиотеки оказывают немало платных услуг: печатно-брошюровочные работы, набор текстов, ксерокопирование, сканирование и составление тематических списков литературы. В культурных центрах можно оплачивать посещение кружков и секций, покупать билеты на различные мероприятия. Рассчитаться при помощи терминала можно не только за предоставляемые услуги, но также оплатить мобильную связь, интернет, услуги ЖКХ и штрафы. 
Библиотеки и культурные центры ЮЗАО, где установлены платежные терминалы, расположены по следующим адресам: 
- центр культуры и досуга “ Лира ” , бульвар Адмирала Ушакова, дом 12; 
- культурный центр “ Вдохновение ” , Литовский бульвар, дом 7; 
- библиотека № 170, улица Паустовского, дом 2/34; 
- библиотека № 175, улица Ремизова, дом 10; 
- библиотека № 189, улица Маршала Савицкого, дом 12, корпус 1; 
- библиотека № 192, улица Старобитцевская, дом 23, корпус 2; 
- библиотека № 193, улица Грина, дом 11; 
- библиотека № 195, улица Адмирала Лазарева, дом 61; 
- центр культуры “ Сцена ” , улица Островитянова, дом 15, корпус 1; 
- центр культуры и искусства “ Меридиан ” , Профсоюзная улица, дом 61. / вторник, 7 ноября 2017 года /
